import './App.css';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function App(){
  return(
    <Router>
      <div>
        <ul>
          <li>
            <Link to = "/">Home</Link>
          </li>
          <li>
            <Link to = "/information">Information</Link>
          </li>
        </ul>

        <hr />
        <Switch>
          <Route exact path ="/">
            <Home />
          </Route>
          <Route path = "/information">
            <Information />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

